import React from 'react';

import adapter from '../adapter'

var ListOfStreams = []

let streams = adapter.getStreams()
.then(streamsList => getstreamsList(streamsList))


function getstreamsList(list) {
  ListOfStreams = list;
  return ListOfStreams;
}


const Streams = () => {
  return (
    <div>
      <h1>Streams Page</h1>
      {console.log(streams)}
    </div>
  );
};

export default Streams;
